import React from 'react';
import PopupWithForm from './PopupWithForm.js';

function ConfirmPopup({deleteCard:{isOpen, card}, onClose, onCardDelete, isRender}) {
    function handleSubmit(evt) {
        evt.preventDefault();
        onCardDelete(card);
    }
    return (
        <PopupWithForm
        name='confirm'
        title='Вы уверены?'
        btnName='Да'
        isOpen={isOpen}
        onClose={onClose}
        onSubmit={handleSubmit}
        >

        </PopupWithForm>
    );
}

export default ConfirmPopup;
